import React from "react";
import "./App.css";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "Hanyue Shi",
      headerLinks: [
        { title: "Home", path: "/" },
        { title: "About", path: "/about" },
        { title: "Contact", path: "/contact" },
      ],
      home: {
        title: "Be Relentless",
        subTitle: "Projects the make a difference",
      },
    };
  }

  render() {
    return <div>Hello from react</div>;
  }
}

export default App;
